import { useState } from 'react'
import './App.css';


const Button = (props) => (

  <button onClick={props.handleClick}>{props.text}
  </button>

)

const Statistics = (props) => {

  const total = props.good + props.neutral + props.bad // ilman {} sulkeita koska en voi objekteilla laskea
  const average = ((props.good * 1) + (props.bad * -1)) / total
  const positive = (props.good / (props.bad + props.neutral + props.good)) * 100

  if (total === 0) {
    return (
      <div>the app is used by pressing the buttons</div>
    )
  }


  return (
    <table className='lista'>
      <tr>
        <td>good </td> <td>{props.good}</td>
      </tr>
      <tr>
      <tr>neutral {props.neutral}</tr>
      </tr>
      <tr>
      <tr>bad {props.bad}</tr>
      </tr>
      <tr>
      <tr>Total {total}</tr>
      </tr>
      <tr>
      <tr>Average {average}</tr>
      </tr>
      <tr>
      <tr>Positive {positive}%</tr>
      </tr>
    </table>
  )
}




const App = () => {
  // tallenna napit omaan tilaansa
  const [good, setGood] = useState(0)
  const [neutral, setNeutral] = useState(0)
  const [bad, setBad] = useState(0)




  return (
    <div>
      <h1>Give feedback</h1>
      <Button handleClick={() => setGood(good + 1)} text="good" />
      <Button handleClick={() => setNeutral(neutral + 1)} text="neutral" />
      <Button handleClick={() => setBad(bad + 1)} text="bad" />
      <h1>Statistics</h1>

      <Statistics
        good={good}
        neutral={neutral}
        bad={bad}
      />
    </div>
  )
}

export default App
